import React, { Fragment } from 'react';
import Sheet from 'react-modal-sheet';
import "./styles.css";


const PlaceABidSoftwareActionHelper = ({ sheetBidOpen, setSheetPaneOpen }) => {
    return (
        <Fragment>
            <Sheet isOpen={sheetBidOpen} onClose={() => setSheetPaneOpen(false)}>
                <Sheet.Container>
                <Sheet.Header />
                <Sheet.Content>{/* Your sheet content goes here */}</Sheet.Content>
                </Sheet.Container>

                <Sheet.Backdrop />
            </Sheet>
        </Fragment>
    );
}

export default PlaceABidSoftwareActionHelper;
